CREATE TABLE  categoria(
    id INTEGER GENERATED BY DEFAULT AS IDENTITY(START WITH 1, INCREMENT BY 1) PRIMARY KEY not null,
    nombre VARCHAR(60) NOT NULL,
    is_activa boolean DEFAULT true

);



CREATE TABLE  sub_categoria(
    id INTEGER GENERATED BY DEFAULT AS IDENTITY(START WITH 1, INCREMENT BY 1) PRIMARY KEY not null,
    nombre VARCHAR(60) NOT NULL,
    is_activa boolean DEFAULT true,
    categoria_id INT,
    FOREIGN KEY (categoria_id) REFERENCES categoria(id)
);



CREATE TABLE  variedad(
    id INTEGER GENERATED BY DEFAULT AS IDENTITY(START WITH 1, INCREMENT BY 1) PRIMARY KEY not null,
    nombre VARCHAR(60) NOT NULL
 
);


CREATE TABLE bodega(
    id INTEGER GENERATED BY DEFAULT AS IDENTITY(START WITH 1, INCREMENT BY 1) PRIMARY KEY not null,
    nombre VARCHAR(100) NOT NULL

);


CREATE TABLE producto (
    id INTEGER GENERATED BY DEFAULT AS IDENTITY(START WITH 1, INCREMENT BY 1) PRIMARY KEY not null,
    nombre VARCHAR(100) NOT NULL,
    precio DECIMAL(6,2) NOT NULL,
    descripcion clob,
    stock int NOT NULL,
    imagen clob NOT NULL,
    is_disponible BOOLEAN NOT NULL,
    sub_categoria_id INT NOT NULL,
    bodega_id INT NOT NULL,
    variedad_id INT ,
    FOREIGN KEY (sub_categoria_id) REFERENCES sub_categoria(id),
    FOREIGN KEY (bodega_id) REFERENCES bodega(id),
    FOREIGN KEY (variedad_id) REFERENCES variedad(id)
);

CREATE TABLE  promocion(
    id INTEGER GENERATED BY DEFAULT AS IDENTITY(START WITH 1, INCREMENT BY 1) PRIMARY KEY not null,
    nombre VARCHAR(100) NOT NULL,
    precio DECIMAL(6,2) NOT NULL,
    producto_id INT,
    FOREIGN KEY (producto_id) REFERENCES producto(id)
    
);

CREATE TABLE  usuario(
    id INTEGER GENERATED BY DEFAULT AS IDENTITY(START WITH 1, INCREMENT BY 1) PRIMARY KEY not null,
    nombre VARCHAR(100) NOT NULL,
    apellido VARCHAR(100) NOT NULL,
    telefono VARCHAR(60),
    email VARCHAR(100) UNIQUE NOT NULL,
    password VARCHAR(68) NOT NULL,
    is_activo BOOLEAN DEFAULT true
);  

