CREATE TABLE  carrito_item(
    id INTEGER GENERATED BY DEFAULT AS IDENTITY(START WITH 1, INCREMENT BY 1) PRIMARY KEY not null,
    cantidad int NOT NULL,
    sub_total DECIMAL(6,2) NOT NULL, 
    producto_id int,
    FOREIGN KEY (producto_id) REFERENCES producto(id)
  
);

CREATE TABLE  carrito(
    id INTEGER GENERATED BY DEFAULT AS IDENTITY(START WITH 1, INCREMENT BY 1) PRIMARY KEY not null,
    fecha_creacion TIMESTAMP,
    total DECIMAL(6,2) NOT NULL,
    cantidad_items integer,
    carrito_item_id int not null,
    usuario_id int,
    FOREIGN KEY (carrito_item_id) REFERENCES carrito_item(id),
    FOREIGN KEY (usuario_id) REFERENCES usuario(id)
);








